import React from 'react';
import card1 from '.././images/card1.jpg';
import card2 from '.././images/card2.jpg';
import card3 from '.././images/card3.jpg';

export default function Cards() {
  return (
    <div className="d-flex mt-5 justify-content-center">
      <div className="mx-5 mb-3">
        <img className="card-img-top" src={card1} alt="Card image cap"/>
        <div class="card-body">
          <h2 className="card-title">Get started with Innotter</h2>
          <p>New to Innotter? Explore these resources to know what to expect along the way.</p>
          <a className="btn btn-primary" href="https://getbootstrap.com/docs/5.2/examples/carousel/?#">View details »</a>
        </div>
      </div>
      <div className="mx-5 mb-3">
        <img className="card-img-top" src={card2} alt="Card image cap"/>
        <h2 className="fw-normal">2022 Global Messenger Survey</h2>
        <p>See what we learned from over 1,000 professionals about speed, security and delivery.</p>
        <a className="btn btn-primary" href="https://getbootstrap.com/docs/5.2/examples/carousel/?#">View details »</a>
      </div>
      <div className="mx-5 mb-3">
        <img className="card-img-top" src={card3} alt="Card image cap"/>
        <h2 className="fw-normal">See what you could do</h2>
        <p>Communicate and stay connected through the exchange of quick, frequent messages.</p>
        <a className="btn btn-primary" href="https://getbootstrap.com/docs/5.2/examples/carousel/?#">View details »</a>
      </div>
    </div>

  );
}
